@evan_demarco & I wrap up the year with the final episode of 2020! 🎬 Come join the party as we pop a bottle of champagne and discuss our favorite moments of the year, what’s to come in 2021 and an exciting announcement about The Ranch. Keep watching for some bloopers & laughs at the end!

🎧🎥 Listen on your preferred podcast platform or watch the full video on our YouTube/website!

